    """
    n = int(stdin.readline().strip())
    graph = defaultdict(dict)
    for _ in range(n - 1):
        a, b = map(int, stdin.readline().split())
        graph[a][b] = graph[b][a] = 1
    a, b, c = map(int, stdin.readline().split())
    distances = dijkstra(graph, a, b)
    for c in (c, b, a):
        if distances[c] > distances[a] + distances[b]:
            return "IMPOSSIBLE"
    return str(max(distances[a], distances[b], distances[c]))


