    """
    Calculates the expected score for a game played optimally.

    Args:
        stdin (str): stdin of the user
    Returns:
        str: expected score
    """
    n, k = [int(x) for x in stdin.split()]
    dp = [[0] * (k + 1) for _ in range(n + 1)]
    dp[0][0] = 1
    for i in range(1, n + 1):
        for j in range(1, k + 1):
            if i == 1:
                dp[i][j] = j / (2 * i)
            else:
                dp[i][j] = (dp[i][j - 1] + j / (2 * i)) / (1 + i)
    return str(sum(dp[n]))

